import axios from "axios";

const API_URL = 'https://dev-api.konfhub.com/event/public/konfhub-frontend-evaluation-task';

export const fetchEvents = async() => {
    try{
        const response = await axios.get(API_URL);
        return response.data;
    }

    catch(error) {

    }
};
